  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Wertheim
  National Wildlife Refuge outlines Refuge accomplishments during the 1984 calendar
  year. The report begins by giving a brief introduction to the Refuge, as well as
  the climatic and habitat conditions and land acquisition program. The planning section
  discusses the master plan, management plan, public participation, compliance with
  environmental mandates, and research and investigations. Administration topics are
  included; topics include personnel, youth programs, volunteer programs, funding,
  safety, and technical assistance. The habitat management section discusses wetlands,
  forests, grasslands, other habitats, fire management, and pest control. Wildlife-
  including endangered and threatened species, waterfowl, marsh and water birds, shorebirds,
  raptors, other migratory birds, game mammals, other resident wildlife, fisheries
  resources, and marking and banding- is also covered. The public use section discusses
  outdoor classrooms, fishing, and law enforcement. The equipment and facilities section
  discusses new construction, rehabilitation, major maintenance, equipment utilization
  and replacement, communications systems, and energy conservation. Cooperative programs
  and items or interest are discussed. Photographs are attached. Brief narratives
  on Lido and Oyster Bay National Wildlife Refuges are included.\",\n\t\"owner_org\":
